import styles from './Home.module.scss'
import Banner from 'components/Banner'
import Post from 'components/Post'

import posts from 'json/posts.json'

export default function Home() {
  return (
    <main>
      <Banner />
      <ul className={styles.posts}>
        {posts.map((post) => {
          return (
            <Post posts={posts}/>          )
        })}
      </ul>
    </main>
  )
}
